import React from "react";
import "./Charts.css";
import {Line} from "react-chartjs-2";
import {chartData} from "./Tickers.js";

const options = {
    legend: {
        display: false,
    },
    hover: {
        intersect: false
    },
    elements: {
        line: {
            tension: 0
        },
        point: {
            radius: 0,
        },
    },
    maintainAspectRatio: false,
    tooltips: {
        mode: "index",
        intersect: false,
        callbacks: {
        },
    },
    scales: {
        xAxes: [
            {
                type: "time",
                time: {
                    format: "MM/DD/YY",
                    tooltipFormat: "ll",
                },
                ticks: {
                    display: false,
                }
            },
        ],
        yAxes: [
            {
                gridLines: {
                    display: false,
                },
                ticks: {
                    display: false,
                },
            },
        ],
    },
};


function Charts() {



    return (
        <div className="charts_wrapper">
            <Line data={{
                //labels: ['January', 'February', 'March', 'April', 'May', 'June'],
                datasets: [
                    {
                        type: 'line',
                        //backgroundColor: "black",
                        //borderColor: "#5AC53B",
                        borderWidth: 2,
                        pointBorderColor: 'rgba(0, 0, 0, 0)',
                        pointBackgroundColor: 'rgba(0, 0, 0, 0)',
                        pointHoverBackgroundColor: '#5AC53B',
                        pointHoverBorderColor: '#000000',
                        pointHoverBorderWidth: 4,
                        pointHoverRadius: 6,
                        //data: chartData.get("GTBY"),
                    },
                ],
            }}
          options={options}
            />
        </div>
    )
}






export default Charts
